class IDefaultGateway{constructor(){this.eventsArray=[],this.currentEventIndex=0}newEvent(eName,eData){this.eventsArray.push({name:eName,data:eData})}hasEvent(){return this.currentEventIndex<this.eventsArray.length}clearEventsArray(){this.eventsArray.splice(0,this.currentEventIndex),this.currentEventIndex=0}}class GatewayToGodot extends IDefaultGateway{getCurrentEvent(){return this.eventsArray[this.currentEventIndex]}getCurrentEventName(){return this.getCurrentEvent().name}getCurrentEventData(){return this.getCurrentEvent().data}next(){this.currentEventIndex++}}class GatewayToJS extends IDefaultGateway{popEvent(){return this.eventsArray[this.currentEventIndex++]}}const gatewayToGodot=new GatewayToGodot,gatewayToJS=new GatewayToJS;